import classes from './Cars.module.css';

const Cars = (props) => {

    const cars = props.userCars.map(car => {
        <li>{car.brand}</li>
    })
    console.log(props.userCars);

  return (
    <div className="cars-list">
      <ul>
        <li>BMW E46 320D</li>
        <li>BMW E30 316i</li>
      </ul>
    </div>
  );
};

export default Cars;
